import axios from 'axios';


export const getOrderProductsByNickname = (nickname) => {
    return (
        axios.get(`http://localhost:3000/products/orderedProducts/${nickname}`)
            .then(res => {
                if(res.ok) {
                    return res.data.json()
                }
            }).then(resJson => resJson)
            .catch(error => console.log("SPmething went wrong!!!", error))
    )
}
